//引入Count的UI组件
import CountUI from '../../components/Count'

//引入connect用于连接UI组件与redux
import {connect} from 'react-redux'

//a函数返回对象中的key就作为作为状态传递给了UI组件
function a() {
    return {n:900}
}

//b函数的返回值作为状态传递给了UI组件
function b() {
    
}
//使用connect()()创建并暴露一个Count的容器组件
export default  connect(a,b)(CountUI)
